#!/usr/bin/env python3

s1 = """"""
k1 = 3452


def merge_the_tools(string, k):
    # your code goes here
    str_len = len(string)

    start = 0
    end = k

    while end < str_len + 1:
        try:
            l1 = []
            [l1.append(x) for x in string[start:end] if x not in l1]

            print(''.join(l1))
            start = end
            end += k
        except IndexError:
            break


def merge_the_tools_2(S, N):
    """
    This is another option to solve this issue, very good way
    """
    for part in zip(*[iter(S)] * N):
        d = dict()
        print(''.join([d.setdefault(c, c) for c in part if c not in d]))


if __name__ == '__main__':
    merge_the_tools('AABCAAADA', 3)
    merge_the_tools(s1, k1)
    print(len(s1))
